I had to build a base and a frame above, since I went all the way to the ceiling. I also had to do the electrical work. In the end, we had a painter scheduled. I rescheduled him once, but then it was as late as we could do it because we had people coming into town. I literally pulled an all-nighter and was cutting the last piece of trim when the painter''s van rolled up. While they were setting up, I was using the brad nailer to put the last pieces up. 

We got it done just in time, and we love the result.', 'This artifact is a testament to dedication and craftsmanship, documenting the journey of transforming Ikea bookshelves into custom built-ins. Despite challenges with finding matching crown molding and executing precise electrical work, the project was completed just in time for visiting guests. The sense of accomplishment is encapsulated in the memory of installing the final pieces as the painter arrived.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643108187-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg": "A cozy, stylish study with bookshelves, a leather chair, unique lighting, and a large window.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643111482-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459985_image.jpg": "A golden wall-mounted light illuminates an elegant bookshelf filled with various books and art."}', 'done', NULL, NULL, '{}', '{}', '{}', 'built-on-office-bookshelf', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643108187-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762459941/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762459941/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762459941/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg", "me