INSERT INTO public.artifacts VALUES ('2fdd3ef5-8d84-41a0-ba79-da816dabeb83', '892bb7a1-a9e3-40db-8017-e6b27cc603d7', 'bfdd8a71-3816-4823-8d5d-f31880b57eaa', 'Finishing a staircase post', 'Features unique design elements characteristic of its era. This particular piece was acquired in 1966.', 1966, 'Paris, France', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/2fdd3ef5-8d84-41a0-ba79-da816dabeb83/1764642629280-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/2fdd3ef5-8d84-41a0-ba79-da816dabeb83/1764642632347-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg}', '2025-10-30 16:34:14.578866+00', '2025-11-06 16:07:19.317+00', NULL, 'This cherished photo captures a moment of transformation in a family home, where someone is preparing to bring new life to their living space. The image shows a modern interior with wooden floors, a ladder, and supplies indicating an ongoing painting project near the staircase. The scene reflects not just a change in decor, but a touching reminder of the care and effort put into creating a welcoming environment for loved ones.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/2fdd3ef5-8d84-41a0-ba79-da816dabeb83/1764642629280-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg": "Person preparing to paint, with ladder and drop cloth near a staircase in a modern home.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/2fdd3ef5-8d84-41a0-ba79-da816dabeb83/1764642632347-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg": "A modern living space with wooden floors, a ladder, and ongoing painting work near the stairs."}', 'done', NULL, NULL, '{}', '{}', '{}', 'finishing-a-staircase-post', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/2fdd3ef5-8d84-41a0-ba79-da816dabeb83/1764642629280-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762445100/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762445100/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762445100/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762445100/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445100_IMG_1127.jpg"}, "https://res.cloudinary.com/diamuiww7/image/upload/v1762445102/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762445102/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762445102/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762445102/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762445101_IMG_1128.jpg"}}');
