INSERT INTO public.artifacts VALUES ('c8cd2d1d-889e-4bec-9997-43661aba481c', '893cd3a8-dc8a-4f2e-9484-e642d411a878', 'bfdd8a71-3816-4823-8d5d-f31880b57eaa', 'multiple pictures and ai (PUB)', 'artifact with multiple pictures and ai', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/c8cd2d1d-889e-4bec-9997-43661aba481c/1764643053593-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762361675_8n1q1f0250__1124960_.jpg}', '2025-11-05 16:54:41.905679+00', '2025-12-02 17:06:29.06+00', NULL, 'This cherished photograph captures the joy and innovation synonymous with an MGX Party event. Featuring four individuals animatedly interacting through speech bubbles, the image exudes a sense of camaraderie and technological excitement. Another striking image showcases a playful interaction between a man and a sophisticated humanoid robot, marked by its tablet interface, at a lively conference setting.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/c8cd2d1d-889e-4bec-9997-43661aba481c/1764643053593-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762361675_8n1q1f0250__1124960_.jpg": "Four people happily posing with speech bubbles at an MGX Party event."}', 'done', NULL, NULL, '{}', '{}', '{}', 'multiple-pictures-and-ai-pub', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/bfdd8a71-3816-4823-8d5d-f31880b57eaa/c8cd2d1d-889e-4bec-9997-43661aba481c/1764643053593-bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762361675_8n1q1f0250__1124960_.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762361675/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762361675_8n1q1f0250__1124960_.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762361675/heirloom/artifacts/images/bfdd8a71-3816-4823-8d5d-f31880b57eaa_1762361675_8n1q1f0250