INSERT INTO public.artifacts VALUES ('0c296d59-2a2b-47fb-8ead-a39d9d413e7b', 'a38bfc11-1276-4b3a-ac33-cca0efe7d884', '7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed', 'Boxed beams and family room ceiling', 'This is my manual description.', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/0c296d59-2a2b-47fb-8ead-a39d9d413e7b/1764642916790-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/0c296d59-2a2b-47fb-8ead-a39d9d413e7b/1764642918323-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg}', '2025-11-06 20:45:01.202996+00', '2025-11-06 21:28:43.279+00', 'Our builder wanted $7,000 to install these ceiling beams, which is ridiculous. I did it for about $700 in materials and labor. A guy who was working on the porch, just a basic punch carpenter, helped me out a little bit. I paid him by the hour to hold stuff up. I did a custom mix on the stain, using a mushroom color and ebony together to get the final result. We''re happy with it.', 'This heirloom reflects the craftsmanship and resourcefulness of a family project, where the ceiling beams were installed for a fraction of the quoted price. The owner, with the help of a local carpenter, achieved a beautiful result using a custom stain mix. It stands as a testament to the ingenuity and hands-on approach that made their space truly unique.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/0c296d59-2a2b-47fb-8ead-a39d9d413e7b/1764642916790-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg": "A cozy living room with a fireplace, sectional sofa, artwork, and large windows.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/0c296d59-2a2b-47fb-8ead-a39d9d413e7b/1764642918323-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg": "A close-up of a wooden beam against a white ceiling, showcasing natural wood grain."}', 'done', NULL, NULL, '{}', '{}', '{}', 'boxed-beams-and-family-room-ceiling', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/0c296d59-2a2b-47fb-8ead-a39d9d413e7b/1764642916790-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762461776/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762461776/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762461776/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762461776/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461776_image.jpg"}, "https://res.cloudinary.com/diamuiww7/image/upload/v1762461808/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762461808/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762461808/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762461808/heirloom/artifacts/images/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762461808_image.jpg"}}');
