/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/d55c393f-9b65-49f4-ae10-0cd918df5b53/1764642922493-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762398180_IMG_1143.jpg": "Close-up of a metal watch case with a visible mounting screw on a wrist.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/d55c393f-9b65-49f4-ae10-0cd918df5b53/1764642924890-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762398213_IMG_1142.jpg": "Close-up of a metallic watch bezel on a wrist, highlighting detailed grooves and texture.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/d55c393f-9b65-49f4-ae10-0cd918df5b53/1764642928468-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762398289_IMG_1141.jpg": "Close-up of a stainless steel watch case with visible polishing and brushed texture."}', 'done', NULL, NULL, '{}', '{}', '{}', 'avi-8-automatic', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/d55c393f-9b65-49f4-ae10-0cd918df5b53/1764642920505-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762389904_image.jpg', '65fe8dad-de11-4b03-a9f9-7411685b88f9', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762389910/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762389904_image.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762389910/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762389904_image.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762389910/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762389904_image.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762389910/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762389904_image.jpg"}, "https://res.cloudinary.com/diamuiww7/image/upload/v176239