INSERT INTO public.artifacts VALUES ('1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9', '5d83a4b9-9e75-4a6f-b24a-69ae6cbce91e', '9ee6586e-12c5-4226-b2ba-4e8a03617ed6', 'Shinola', 'This is probably my all-time favorite watch...', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643074384-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467390_IMG_1144.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643078967-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467426_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643081187-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467448_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643082819-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467498_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643084248-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467526_recording_1762467526116.webm,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643085366-image_1764101338100.jpg}', '2025-11-06 22:18:51.50243+00', '2025-11-30 19:49:47.589+00', 'This is probably one of my favorite watches, if not certain, my favorite watch. It''s a Shinola. It is just quartz, but it is one of the first ones they made. I really love how it looks, and I''m attached to it because I''ve had it for a long time.', 'This cherished Shinola watch holds a special place in its owner''s heart. With its classic black dial and leather strap, it exemplifies the craftsmanship and heritage of watches "Built in Detroit." As one of the first quartz models produced by Shinola, it carries both historical significance and personal sentiment, having been a longtime companion.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643085366-image_1764101338100.jpg": "A person wearing a Shinola wristwatch with a black dial and brown leather strap.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643078967-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467426_image.jpg": "Back of a Shinola watch with a leather strap, showing the serial number and \"Built in Detroit.\"", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643081187-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467448_image.jpg": "Close-up of a Shinola watch back, highlighting the Detroit-built craftsmanship and serial number.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643082819-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467498_image.jpg": "Vintage-style Shinola wristwatch with a black dial and leather strap on soft fabric.", "https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/1d6e2cc7-ecc8-462e-98fc-94a4ca6588f9/1764643074384-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762467390_IMG_1144.jpg": "A Shinola Argonite-5021 watch with a leather strap on a person''s wrist."}', 'done', NULL, NULL, '{}', '{}', '{}', 'shinola', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617