INSERT INTO public.artifacts VALUES ('ced717b4-9e33-4daa-9360-7d81d5bf7d28', '50317d18-938e-4887-9ff3-73b56fb11de5', '9ee6586e-12c5-4226-b2ba-4e8a03617ed6', 'Random Photos', 'Random project photos...', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/ced717b4-9e33-4daa-9360-7d81d5bf7d28/1764643024256-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg}', '2025-11-07 21:29:33.77601+00', '2025-11-29 00:24:24.532+00', NULL, 'This image captures the serene view from a classic wooden porch, where a black railing frames a lush, grassy yard. The scene is enhanced by the vibrant colors of autumn, offering a sense of nostalgia and tranquility. This porch likely serves as a cherished spot for relaxation and family gatherings.', '{"https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/ced717b4-9e33-4daa-9360-7d81d5bf7d28/1764643024256-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg": "A wooden porch column and black railing overlook a grassy yard with autumn trees in the background."}', 'done', NULL, NULL, '{}', '{}', '{}', 'random-photos', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/ced717b4-9e33-4daa-9360-7d81d5bf7d28/1764643024256-9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762550962/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762550962/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762550962/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762550962/heirloom/artifacts/images/9ee6586e-12c5-4226-b2ba-4e8a03617ed6_1762550960_image.jpg"}}');
INSERT INTO public.artifacts VALUES ('8f0f0c59-dac7-4f7e-a4af-6a3e431166f6', '0eb35e13-6998-46c3-9f1a-dade3343bf1f', '7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed', 'Sydney, Australia 2022', 'We took this family photo in front of the Opera House on a beautiful day', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/8f0f0c59-dac7-4f7e-a4af-6a3e431166f6/1764561030482-image.jpg}', '2025-12-01 03:51:58.725788+00', '2025-12-02 22:14:21.028+00', NULL, NULL, NULL, NULL, NULL, NULL, '{}', '{}', '{}', 'sydney-australia-2022-1764561118366', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/8f0f0c59-dac7-4f7e-a4af-6a3e431166f6/1764561030482-image.jpg', NULL, NULL);
INSERT INTO public.artifacts VALUES ('e4a15d94-1a47-474a-8c07-e4f307158b0d', 'a38bfc11-1276-4b3a-ac33-cca0efe7d884', '7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed', 'Built-on office bookshelf', 'We had some IKEA Billy bookcases on this wall four years but we finally spent some time improving the office. I converted the bookcases to built-ins which involved getting into the Large crown molding and installing lighting. We did a color drench on the ceiling, trim, and walls as well.', 2025, 'Bromley house', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643108187-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459941_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643111482-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762459985_image.jpg,https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed/e4a15d94-1a47-474a-8c07-e4f307158b0d/1764643116288-7efa7d6f-7e9a-414f-8462-c4fd4a9f10ed_1762460009_image.jpg}', '2025-11-06 20:16:30.108171+00', '2025-11-11 22:38:14.754+00', 'We were hoping this would be a relatively quick project, since there’s so much on the internet about creating built-ins from Ikea bookshelves. However, in actuality, it was pretty difficult. I had to create a 3D model to plan everything out and dig into the two-piece, very large crown molding to find a match for the profile, which was very challenging. I finally got one piece of it for about $50.
INSERT INTO public.artifacts VALUES ('c089edc6-ea31-4b22-9de0-91e1f88f34d9', 'f06e8812-1f6a-4a49-b844-48340cc18e2a', '9ee6586e-12c5-4226-b2ba-4e8a03617ed6', 'Lazy fire flames...', 'Flames of fire fom a gas furnace', NULL, '', '{https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/c089edc6-ea31-4b22-9de0-91e1f88f34d9/1764643119329-20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg}', '2025-11-11 16:08:27.303557+00', '2025-11-23 04:23:15.909+00', NULL, NULL, '{}', NULL, NULL, NULL, '{}', '{}', '{}', 'lazy-fire-flames', 'https://lfssobatohlllwuieauc.supabase.co/storage/v1/object/public/heirlooms-media/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/c089edc6-ea31-4b22-9de0-91e1f88f34d9/1764643119329-20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg', '1971d99d-968c-48c9-9b61-c79fdb599e50', '{"https://res.cloudinary.com/diamuiww7/image/upload/v1762878019/users/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/artifacts/2025/11/20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg": {"large": "https://res.cloudinary.com/diamuiww7/image/upload/w_1600,c_limit,q_auto,f_auto/v1762878019/users/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/artifacts/2025/11/20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg", "thumb": "https://res.cloudinary.com/diamuiww7/image/upload/w_400,h_400,c_fill,q_auto,f_auto/v1762878019/users/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/artifacts/2025/11/20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg", "medium": "https://res.cloudinary.com/diamuiww7/image/upload/w_1024,c_limit,q_auto,f_auto/v1762878019/users/9ee6586e-12c5-4226-b2ba-4e8a03617ed6/artifacts/2025/11/20250917_OHRYoungMoose_EN-US2991221135_UHD_bing.jpg"}}');
